import React from 'react';
import { Line } from 'react-chartjs-2';

function LineChart({ chartData }) {
    return (
        <div>
            <Line
                data={chartData}
                options={{
                    scales: {
                        x: {
                            title: {
                                display: true,
                                text: 'Years',
                            },
                        },
                        y: {
                            title: {
                                display: true,
                                text: 'Number of Donors',
                            },
                        },
                    },
                }}
            />
        </div>
    );
}

export default LineChart;
